  constructor(props){
    super(props)
    this.state ={
      goods:[
        {
          id: 1,
          title:'Питца',
          img:'',
          desc:'Lorem ',
          categori:'Pizza',
          price:'968р',
        }
      ]
    }
  }
  render(){
    return (
      <div className="wrapper">
        <Header />
        <Goods />
        <Footer />
      </div>
    );
  }
}

export default App;
